using namespace std;

int main() {
    int a, b;
    cin >> a >> b;
    
    int res = 0;
    while(a != b) {
        if(a > b) {
            swap(a, b);
        }
        int delitel = 1;
        int koren = sqrt(a);
        for(int i = 2; i <= koren; i++) {
            if(a % i == 0) {
                delitel = a / i;
                break;
            }
        }
        int razlika = b - a;
        int kolku_pati = razlika / delitel;
        if(razlika % delitel > 0) {
            kolku_pati++;
        }
        b -= kolku_pati * delitel;
        res += kolku_pati;
        
    }
    cout << res << endl;
    return 0;
}

